import React from 'react';

const List =({ Tasks }) => {
    return(
        <ul>
            {
                Tasks.map((Task, index) => <p 
                                            key={index} 
                                            style={{width: 400}}>{Task}</p>)
            }
        </ul>
    )

    var Names = Tasks.map((Task, index) => Task);
    console.log(Names);

}

export default List;
